import "./App.css";
import Header from "./components/Header";
import Page from "./components/page";

function App() {
  const topLink = [
    {
      linkTitle: "Dashboard",
      linkURL: "/admin",
      linkIcon: <DashboardIcon />
    },
    {
      linkTitle: "Starred",
      linkURL: "/admin",
      linkIcon: <DashboardIcon />
    },
    {
      linkTitle: "Send email",
      linkURL: "/admin",
      linkIcon: <InboxIcon />
    },
    {
      linkTitle: "Drafts",
      linkURL: "/admin",
      linkIcon: <MailIcon />
    },
  ]
  const planSection = [
    {
      linkTitle: "Vision, Values & Mission",
      linkURL: "/admin",
    },
    {
      linkTitle: "Financial Measures",
      linkURL: "/admin",
    },
    {
      linkTitle: "Our Offer",
      linkURL: "/admin",
    },
    {
      linkTitle: "Pest Analysis",
      linkURL: "/admin",
    },
    {
      linkTitle: "Swot Analysis",
      linkURL: "/admin",
    },
    {
      linkTitle: "Goals & Objectives",
      linkURL: "/admin",
    },
    {
      linkTitle: "Strategies",
      linkURL: "/admin",
    },
    {
      linkTitle: "Section 9",
      linkURL: "/admin",
    },
    {
      linkTitle: "Section 10",
      linkURL: "/admin",
    },
  ]
  return (
    <div>
      <Header />
      <Page />
    </div>
  );
}

export default App;
